import styled from 'styled-components';
import Card from '../../../../card/Card';


const MainDiv = styled.div
`
    background: red;
    min-height: 300px;
    display:flex;
    flex-wrap:wrap;
    justify-content: cent;
    
    
`;

const Search = () => {
    return(
        <MainDiv>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>

        </MainDiv>
    )
}

export default Search;
